export default function Swatch(props) {
    function colorChangeHandler(props){
        console.log(props.color)
    }
    return (
        <button className="swatch" style={props.style} color={props.hash} onClick={colorChangeHandler}>
            {props.title} <span className="hash">{props.hash}</span>
        </button>
    )
}
